int baseBigMap[BIGMAP_Y][BIGMAP_X];

int map[DEF_MAP_Y][DEF_MAP_X];

//宣言と初期化
int map_y = DEF_MAP_Y;
int map_x = DEF_MAP_X;
int scrollStop_y = DEF_SCROLLSTOP_Y;
int scrollStop_x = DEF_SCROLLSTOP_X;

int bigPosY = PLAYER_Y;
int bigPosX = PLAYER_X;
int scroll_Y = 0;//スクロールのためのずらす数y軸
int scroll_X = 0;//スクロールのためのずらす数x軸

int prevBigPosY = PLAYER_Y;
int prevBigPosX = PLAYER_X;

int numInput = 0;

char inputKey = '\0';

//==================================================
//main関数（エントリーポイント）
//==================================================
int main(void)
{
	//初回ベースマップの設定
	for (int y = 0; y < BIGMAP_Y; y++)
	{
		for (int x = 0; x < BIGMAP_X; x++)
		{
			baseBigMap[y][x] = bigMap[y][x];
		}
	}



	for (;;)
	{
		movePlayer();

		obstacleDetection();

		mapScroll();

		initializeMap();

		//移動後プレイヤー位置設定
		map[bigPosY - scroll_Y][bigPosX - scroll_X] = 99;

		//消して描画
		system("cls");
		drowMap();

		//デバッグ用テキスト
		std::cout << "\nbigPosX,Y " << bigPosX << " / " << bigPosY;
		std::cout << "\nscroll_X,Y " << scroll_X << " / " << scroll_Y;

		//こわれてる　std::cout << "\n\n　I：設定";

		//キー入力受付
		inputKey = _getch();
		
		/*
		//移動以外の判断
		if (inputKey == 'i')
		{
			setting();
		}
		*/
	}
}

//==================================================
//設定関数 （壊れてるので呼び出しなし）
//==================================================
void setting(void)
{
	bool quit = false;

	while (quit == false)
	{
		system("cls");

		//デバッグ用テキスト
		std::cout << "\n　設定";
		std::cout << "\n\n　1.マップ描画範囲の変更";
		std::cout << "\n\n　2.マップ描画範囲を初期設定に戻す";
		std::cout << "\n\n　9.ゲームに戻る";
		std::cout << "\n\n　数字を入力してください\n\n";

		inputKey = _getch();

		system("cls");

		//サイズ変更（壊れてる）
		if (inputKey == '1')
		{
			system("cls");


			std::cout << "\n\n　縦のマップ描画サイズを入力してください（初期設定：" << DEF_MAP_Y << " フルスクリーン表示の目安：50）\n\n　>> ";
			std::cin.seekg(0);
			std::cin >> map_y;

			std::cout << "\n\n　横のマップ描画サイズを入力してください（初期設定：" << DEF_MAP_X << " フルスクリーン表示の目安：190）\n\n　>> ";
			std::cin.seekg(0);
			std::cin >> map_x;

			scrollStop_y = map_y / 2;
			scrollStop_x = map_x / 2;

			std::cout << "\n\n　設定しました\n\n　エンターで戻る";

			std::cin.seekg(0);
			std::cin.get();
		}
		//描画初期
		else if (inputKey == '2')
		{
			system("cls");

			map_y = DEF_MAP_Y;
			map_x = DEF_MAP_X;
			scrollStop_y = DEF_SCROLLSTOP_Y;
			scrollStop_x = DEF_SCROLLSTOP_X;

			std::cout << "\n　マップ描画範囲を初期設定に戻しました\n\n　エンターで戻る";

			std::cin.seekg(0);
			std::cin.get();
		}
		//退出
		else if (inputKey == '9')
		{
			quit = true;
		}
	}
}

//==================================================
//マップ描画関数
//==================================================
void drowMap()
{
	//マップの描画
	for (int y = 0; y < map_y; y++)
	{
		for (int x = 0; x < map_x; x++)
		{
			switch (map[y][x])
			{
			case 1:
				std::cout << '*';
				break;
			case 2:
				std::cout << '-';
				break;
			case 3:
				std::cout << '|';
				break;
			case 4:
				std::cout << '=';
				break;
			case 5:
				//左端無視
				if (x == 1 && scroll_X == 0)
				{
					std::cout << "";
				}
				//右端枠線崩壊防止
				else if (x == map_x - 2 && scroll_X >= BIGMAP_X - map_x)
				{
					std::cout << " ";
				}
				else if (x % 2 == 1)
				{
					std::cout << "≡";
				}
				break;
			case 6:
				std::cout << '~';
				break;
			case 7:
				if (x < bigPosX - scroll_X)
				{
					std::cout << '(';
				}
				else if (x == bigPosX - scroll_X)
				{
					std::cout << '|';

				}
				else
				{
					std::cout << ')';
				}
				break;
			case 50:
				std::cout << 'S';
				break;
			case 99:
				std::cout << 'P';
				break;
			default:
				std::cout << ' ';
				break;
			}
		}

		std::cout << "\n";
	}
}

//==================================================
//プレイヤー移動関数
//==================================================
void movePlayer()
{
	//１つ前のプレイヤー位置保持
	prevBigPosY = bigPosY;
	prevBigPosX = bigPosX;

	//入力判定
	if (inputKey == 'w')
		bigPosY -= 1;
	if (inputKey == 's')
		bigPosY += 1;
	if (inputKey == 'a')
		bigPosX -= 1;
	if (inputKey == 'd')
		bigPosX += 1;
}

//==================================================
//障害物判定関数
//==================================================
void obstacleDetection()
{
	switch (baseBigMap[bigPosY][bigPosX])
	{
	case 1:
		bigPosY = prevBigPosY;
		bigPosX = prevBigPosX;
		break;
	case 2:
		bigPosY = prevBigPosY;
		bigPosX = prevBigPosX;
		break;
	case 3:
		bigPosY = prevBigPosY;
		bigPosX = prevBigPosX;
		break;
	case 5:
		bigPosY = prevBigPosY;
		bigPosX = prevBigPosX;
		break;
	default:
		break;
	}

}

//==================================================
//マップスクロール関数
//==================================================
void mapScroll()
{
	//Y・縦

	//プレイヤー中心に来るまで
	if (bigPosY <= scrollStop_y)
	{
		scroll_Y = 0;
	}
	//プレイヤー中心
	else if (bigPosY > scrollStop_y && bigPosY - scrollStop_y < BIGMAP_Y - map_y)
	{
		scroll_Y = bigPosY - scrollStop_y;
	}
	//プレイヤー下端に到達
	else
	{
		scroll_Y = BIGMAP_Y - map_y;
	}

	//X・横

	//プレイヤー中心に来るまで
	if (bigPosX <= scrollStop_x)
	{
		scroll_X = 0;
	}
	//プレイヤー中心
	else if (bigPosX > scrollStop_x && bigPosX - scrollStop_x < BIGMAP_X - map_x)
	{
		scroll_X = bigPosX - scrollStop_x;
	}
	//プレイヤー右端に到達
	else
	{
		scroll_X = BIGMAP_X - map_x;
	}
}

//==================================================
//マップ初期化関数
//==================================================
void initializeMap(void)
{
	//描画マップ設定
	for (int y = 0; y < map_y; y++)
	{
		for (int x = 0; x < map_x; x++)
		{
			map[y][x] = baseBigMap[scroll_Y + y][scroll_X + x];
		}
	}
}

